import React, {Component} from 'react';

class Pagination extends Component{
	constructor(props){
		super(props);
	}

	render(){
		return (
			<div className="filter-main-container">
				<button>Prev</button>
				<div> Page <span>1</span></div>
				<button>Next</button>
		     </div>
			);
	}
}

export default Pagination;
